window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.2.0","implementation":{"version":"8.3.1 (playwright 1.53.1)","name":"playwright-bdd"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.26100"},"runtime":{"name":"node.js","version":"23.11.1"}}},{"source":{"data":"Feature: Login with credentials\r\n\r\n  Background:\r\n    Given user navigates to the login page\r\n    When  user clicks the sign in button on the homepage\r\n    When user fills the username field with credentials from env\r\n    When the user fills the password field with credentials from env\r\n    When the user clicks the login button\r\n    Then the user should be logged in successfully\r\n\r\n\r\n Scenario: Verify User lands on the medical dashboard\r\n    Given the user should be logged in successfully\r\n    When The user is directed to the dashboard URL\r\n    Then The page should have URL visible \r\n    \r\nScenario: Verify User starts a new assessment\r\n    Given The user is on the dashboard\r\n    When The user clicks on the \"Start New Assessment\" button\r\n    Then the user should be logged in successfully\r\n\r\nScenario: Verify User able to View previous medical assessments\r\n    Given The user is on the dashboard\r\n    When The user clicks the \"View Previous Assessments\" button\r\n    Then The user should be in \"View Previous Assessments\" page\r\n\r\n Scenario: verify User is able See current \"AI analysis usage\"\r\n    Given The user is on the dashboard\r\n    When  dashboard is displayed with 'AI analysis usage'\r\n    Then The page should have URL visible\r\n\r\n Scenario: verify User is able See current \"upgrade to premium\"\r\n    Given The user is on the dashboard\r\n    When verify user is able click on 'upgrade to premium' button\r\n    Then user is on subscription page\r\n\r\n\r\n Scenario: verify User is able to click current Start your first assessment\r\n    Given The user is on the dashboard\r\n    When The user clicks on  the Start your first assessment button\r\n    Then the user should be logged in successfully\r\n\r\n Scenario: verify User is able See current \"Account Settings\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on Update settings under the Account Settings section\r\n    Then The user should directed to Account Settings page\r\n\r\n Scenario: verify User is able See current Subscription Plans\r\n    Given The user is on the dashboard\r\n    When The user clicks on Upgrade now  section   in the Subscription Plans section\r\n     Then user is on subscription page\r\n\r\n\r\n Scenario: verify User is able See current Assessment History\r\n    Given The user is on the dashboard\r\n    When The user clicks on View history  section in the Assessment History section\r\n    Then The user should be in \"View Previous Assessments\" page\r\n\r\nScenario: verify User is able See current \"About Us\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on \"About Us  \"section   in the \"company\" section\r\n    Then The user should directed to \"About Us \"page\r\n\r\n Scenario: verify User is able See current \"Blog\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on \"Blog  \"section   in the \"company\" section\r\n    Then The user should directed to \"Blog\"page\r\n\r\n    Scenario: verify User is able See current \"Contact Us\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on \"Contact Us  \"section   in the \"company\" section\r\n    Then The user should directed to \"Contact Us\"page\r\n\r\n Scenario: verify User is able See current \"Terms\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on \"Terms \"section   in the \"© 2025 Manan - Medical Triage Assistant\" section\r\n    Then The user should directed to \"Terms\"page\r\n\r\n  Scenario: verify User is able See current \"Privacy\"\r\n    Given The user is on the dashboard\r\n    When The user clicks on \"Privacy \"section   in the \"© 2025 Manan - Medical Triage Assistant\" section\r\n    Then The user should directed to \"Privacy\"page\r\n\r\n Scenario: Verify user is able to logout successfully\r\n    Given The user is on the dashboard\r\n    When The user clicks User profile icon and clicks Logout option\r\n    Then The user should get \"Session Ended\" message and rediected to Manan signin Page\r\n\r\n  Scenario: Verify user is able to directed to settings successfully\r\n    Given The user is on the dashboard\r\n    When The user clicks User profile icon and clicks  settings option\r\n    Then The user should directed to \"settings\"page\r\n\r\n  Scenario: Verify user is able to directed to Previous Assessments successfully\r\n    Given The user is on the dashboard\r\n    When The user clicks User profile icon and clicks previous assessment option\r\n    Then The user should directed to \"Previous Assessments\"page\r\n\r\n  Scenario: Verify user is able to directed to subscription plans successfully\r\n    Given The user is on the dashboard\r\n    When The user clicks User profile icon and clicks subscription plans option\r\n    Then The user should directed to \"subscription plans\"page\r\n\r\n     ","uri":"[chromium]:feature\\Dashboard.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"Feature: Manan LandingPage for Unauthenticated User\r\n\r\nBackground: User is not sign in and able to land on the Manan Launch page\r\n    Given the user is not signed in to application\r\n    When the user visits the landing page\r\n\r\nScenario: Show Welcome title \"Transform Your Medical Practice\" and buttons \"Try for Free\" and \"For Medical Professionals\"\r\n    Given the user is not signed in to application\r\n    When the user visits the landing page\r\n    Then the heading 'Transform Your Medical Practice' should be visible\r\n\r\nScenario: Show sign in button in header\r\n    Given the user is not signed in to application\r\n    When the user visits the landing page\r\n    Then Verify the 'Sign In' button should be present in the top right corner\r\n\r\nScenario: Show call-to-action buttons\r\n    Given the user is on the landing page\r\n    When the page is fully loaded\r\n    Then Verify the buttons 'Try for free' and 'For Medical Professionals' should be visible\r\n\r\nScenario: Verify 'Clinical Decision Support Platform today' content is diaplyed\r\n    Given the user is on the landing page\r\n    When the page is fully loaded\r\n    Then Verify 'Upgrade to a clinical decision-support platform today' should be displayed and the buttons 'Start Medical Traige Assessment' and 'View Pricing Plans' should be visible\r\n\r\nScenario: Display footer links and company info\r\n    Given the user scrolls to the bottom of the home page\r\n    Then Verify company description, About Us, Blog, and Contact Us links should be present\r\n\r\nScenario: Verify user is able to Sign In with existing user details\r\n    Given The user is in Welcome to Manan Sign In page\r\n    When User enters valid existing Username and Password and clicks Sign In\r\n    Then User should see Authentication Successful message and redirected to Manan Assessment page\r\n \r\n  Scenario: Verify New User is able to Create account successfully\r\n    Given The user is in Welcome to Manan Sign Up page\r\n    When User enters valid Username, Password, Confirm Password and clicks Create Account\r\n    Then User should see Registration successful message and redirected to Manan Assessment Page\r\n\r\n","uri":"[chromium]:feature\\Home.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"Feature: Manan Medical Triage Assistant \r\n\r\nBackground: User is successfully logged into Manan Application\r\n    Given User is in Manan Home page\r\n    When User enters valid login\r\n\r\nScenario: Verify user is able to successfully analyze case by entering valid data\r\n    Given User is in Manan Medical Triage Assistant page \r\n    When User enters Patient Age, Gender at Birth, Cheif complaint, Detailed Symptoms, upload Blood report, Medical History, and Current medications and clicks Analyze Case\r\n    Then User should be able to see Analysis report with Analysis Complete AI has analysed the case message\r\n\r\nScenario: User should be able to maunally enter Vital Signs & Lab Reports\r\n    Given User is in Manan Medical Triage Assistant page\r\n    When User enters Patient Age, Gender at Birth, Cheif complaint, Detailed Symptoms,  maunally enters Vital Signs & Lab Reports, Medical History, and Current medications and clicks Analyze Case\r\n    Then User should be able to see Analysis report\r\n\r\nScenario: User should be able to analyze case without entering Medical History and Curretn medications \r\n    Given User is in Manan Medical Triage Assistant page\r\n    When User enters Patient Age, Gender at Birth, Cheif complaint, Detailed Symptoms, upload Blood report, and clicks Analyze Case\r\n    Then User should be able to see Analysis report\r\n    \r\nScenario: Verify  user is able to share the report after analysis\r\n    Given User is in  Manan Medical Triage Assistant page after successful analysis\r\n    When User clicks Share Analysis button\r\n    Then User should be able to see a Share window with the analysis pdf\r\n    \r\nScenario: Verify user is able to Ask for Further Analysis\r\n    Given User is in  Manan Medical Triage Assistant page after successful analysis\r\n    When User clicks Ask for Further Analysis\r\n    Then User should be able to see details for further analysis\r\n   \r\nScenario: Verify user is able to upload 5 pdf files\r\n    Given User is in Manan Medical Triage Assistant page\r\n    When User uploads two pdf files\r\n    Then User should see three uploads remaining\r\n   \r\nScenario Outline: Verify user is able to see error when clicking Analyze case without entering required fields\r\n    Given User is in Manan Medical Triage Assistant page\r\n    When User clicks Analyze Case for '<Scenario>'\r\n    Then User should see error message for '<Scenario>'\r\n\r\n    Examples:\r\n    |Scenario|\r\n    |AgeNull|\r\n    |GenderNull|\r\n    |ChiefComplaintNull|\r\n    |SymptomsNull|\r\n    |LabValuesNull|\r\n    ","uri":"[chromium]:feature\\MananAssessment.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Login with credentials","description":"","children":[{"background":{"id":"e2af5719-9dd4-4e50-bcd4-2d31696fd9b4","location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"427ca1f1-af26-41c7-8872-28367d03f697","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"user navigates to the login page"},{"id":"ed503476-44ed-4404-910c-06a476ec106e","location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"user clicks the sign in button on the homepage"},{"id":"8cb320c8-334c-4cd8-ba8e-c15548c2f32b","location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"user fills the username field with credentials from env"},{"id":"81540549-cb1d-42ab-84d7-b3a13421b38c","location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"the user fills the password field with credentials from env"},{"id":"1cd3e325-04d3-4507-bd92-9faa7bd41420","location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"the user clicks the login button"},{"id":"c4156408-bccc-4193-ad37-56ae135ab6da","location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the user should be logged in successfully"}]}},{"scenario":{"id":"35e18f34-2494-429b-8b74-d9c4ec55af00","tags":[],"location":{"line":12,"column":2},"keyword":"Scenario","name":"Verify User lands on the medical dashboard","description":"","steps":[{"id":"681cd926-5294-4d90-8768-89533a9443ce","location":{"line":13,"column":5},"keyword":"Given " <style>
pre:has([data-custom-html]) {
  padding-left: 0.75em !important;
}
pre:has([data-custom-html])::before {
  content: none !important;
}
</style>


<style>
a.view-trace {
  text-decoration: none; 
  color: #297bde;
}

a.view-trace:hover {
  text-decoration: underline;
}
</style>
<script>
function updateTraceViewLink(link) {
  if (!isHttpUrl(window.location.href)) return;
  var urlObj = new URL(link.href);
  var traceUrl = urlObj.searchParams.get('trace') || '';
  if (!isHttpUrl(traceUrl)) {
    traceUrl = new URL(traceUrl, window.location.href).href;
    urlObj.searchParams.set('trace', traceUrl);
    link.href = urlObj.href;
  }
}
function isHttpUrl(url) {
  return url.startsWith('http://') || url.startsWith('https://');
} 
</script>


<script>
function copyPrompt(button, prompt) {
  var originalText = button.textContent;
  if (originalText === 'Copied') return;
  navigator.clipboard.writeText(prompt).then(() => {
    button.textContent = 'Copied';
    setTimeout(() => button.textContent = originalText, 2000);
  });
}
</script>
